const Form = () => {
    return (
    <div className="interested">
        <p>Are you interested with me, and want to collaborate on a project ?</p>
        <form action="">
            <p>CONTACT US</p>
                <input type="text" placeholder="Fullname"/>
                <input type="text" placeholder="Your Email"/>
                <textarea name="" id="" cols="30" rows="10">

                </textarea>
            <button>SEND EMAIL</button>
        </form>
        <style jsx>{`
            .interested {
                text-align: center;
            }
            .interested > p {
                font-size: 2rem;
                font-family: 'Alice',serif;
            }
            form {
                display: flex;
                flex-direction: column;
                width: 23rem;
                margin: 0 auto;
                padding: 20px 0;
            }
            form > p{
                font-family: 'Alice',serif;
                font-size: 1.3rem;
            }
            input{
                height: 2.5rem;
            }
            textarea {
                min-height: 12rem;
            }
            input , textarea{
                border-radius: 20px;
                border: 1px solid #A9A7A7;
            }
        `}</style>
    </div>
)}
export default Form;
